import React, { Component } from 'react';
import Price from './Price'


class Product extends React.Component {
    render() {
        this.price = <Price />
        return (
            <div>  
                    product name  {this.props.name}<br/>
                    product price{this.props.price}
            </div>






        );
    };

}

export default Product;
